import ExpenseItem from "./ExpenseItem";

function Expenses (props) {
  return (
    <div>
        <ExpenseItem
          title={props.iexpenses[0].title}
          amount={props.iexpenses[0].amount}
          date={props.iexpenses[0].date}
        ></ExpenseItem>
        <ExpenseItem
          title={props.iexpenses[1].title}
          amount={props.iexpenses[1].amount}
          date={props.iexpenses[1].date}
        ></ExpenseItem>
        <ExpenseItem
          title={props.iexpenses[2].title}
          amount={props.iexpenses[2].amount}
          date={props.iexpenses[2].date}
        ></ExpenseItem>
        <ExpenseItem
          title={props.iexpenses[3].title}
          amount={props.iexpenses[3].amount}
          date={props.iexpenses[3].date}
        ></ExpenseItem>
      </div>
  );
}

export default Expenses;
